var movies=JSON.parse(localStorage.getItem("movies"));

movielist();
function movielist(){

 movies.map(function(elem)
 {

     var div=document.createElement("div");
     
     var img=document.createElement("img");
     img.setAttribute("src",elem.poster);
     img.setAttribute("alt",elem.name);
     img.setAttribute("id","Product_image");
  
     
     var date=document.createElement("p");
     date.textContent="Release Date: "+elem.date;
     date.setAttribute("id","date")

     var rate=document.createElement("p");
     rate.textContent="rating: "+elem.rating;
     rate.setAttribute("id","rating")

     var name=document.createElement("h4");
     name.textContent=elem.name;
     name.setAttribute("id","name")
     
     div.append(img,name,date,rate);

     document.getElementById("movies").append(div);
 });
}

document.getElementById("sort-lh").addEventListener("click",sortlh);
document.getElementById("sort-hl").addEventListener("click",sorthl);
function sorthl()
{
        movies.sort(function(a,b){
            return b.rating-a.rating;
        
            
        });
        document.getElementById("movies").textContent=null;
        movielist();
    
}

function sortlh(){
    movies.sort(function(a,b){
            return a.rating-b.rating;
        
            
        });
        document.getElementById("movies").textContent=null;
        movielist();
}
